    public class BasicTests
    {

        // A simple test using verified XML from a postman request - this ensures that out code is deserializing correctly - we can potentially test many attributes here.
        [Fact]
        public async Task TestDeserializeAgainstSetXML()
        {
            // Mocking the Http handler allows us to set a specific return value - it also means the Http client never actually makes requests to the API for tests - we can simulate all responses if needed.
            var handlerMock = new Mock<HttpMessageHandler>(MockBehavior.Strict);

            handlerMock.Protected().Setup<Task<HttpResponseMessage>>("SendAsync", ItExpr.IsAny<HttpRequestMessage>(), ItExpr.IsAny<CancellationToken>())
                .ReturnsAsync(new HttpResponseMessage() { StatusCode = System.Net.HttpStatusCode.OK, Content = new StringContent(SetSetXML()) }).Verifiable();

            var httpClient = new HttpClient(handlerMock.Object) { BaseAddress = new Uri("http://test.com/"), };

            var apiAccessor = new FundaApiWrapper("keyDoesntMatterForThisTest", httpClient);

            var result = await apiAccessor.GetProperties(0, 0, "anything", "anything", null);

            result.Objects.Object.Count.ShouldBe(25);
        }


